;; gorilla-repl.fileformat = 1

;; **
;;; # Change the exposure (the contrast) of a picture 
;;; 
;;; Changing the exposure of a picture is rather easy and done simply using the function **convert-to**. 
;; **

;; @@
(ns inquisitive-pond
   (:require
     [opencv4.utils :as u]
     [opencv4.core :refer :all]))

(def org 
  (-> "resources/images/cat.jpg" imread (u/resize-by 0.2)))

(u/mat-view org)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x71ebaf53 \"BufferedImage@71ebaf53: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4e1cbc92 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Making the image darker
;; **

;; @@
(def img1
  (->
 org
 clone
 (convert-to! -1 0.4 0)))
(u/mat-view img1) 
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x62ee7bc \"BufferedImage@62ee7bc: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4e1cbc92 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Making the image brigther
;; **

;; @@
(def img2
  (->
  org
  clone
  (convert-to! -1 2 0)))
  (u/mat-view img2)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6085f39a \"BufferedImage@6085f39a: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4e1cbc92 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def img3 (new-mat))
(add-weighted img1 0.2 img2 0.8 1 img3)
(u/mat-view img3)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x188af505 \"BufferedImage@188af505: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4e1cbc92 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=
